function InProgress() {
    var panelProg = $get('divProgress');
    panelProg.style.display = '';
}
function onComplete() {
    var panelProg = $get('divProgress');
    panelProg.style.display = 'none';
}
function capitalize(input) {
    return input.toLowerCase().split(' ').map(s => s.charAt(0).toUpperCase() + s.substring(1)).join(' ');
}

