var start = function () {
    var wsImpl = window.WebSocket || window.MozWebSocket;

    //inc.innerHTML += "connecting to server ..<br />";
    //console.log('connection to server');

    // create a new websocket and connect
    window.ws = new wsImpl('ws://localhost:8181/');


    // when data is comming from the server, this metod is called
    ws.onmessage = function (evt) {
        //document.getElementById('ctl00_MainContainer_BannerContainer').innerHTML = "Checking on UCAM Desktop Client...";
        //$("#ctl00_MainContainer_BannerContainer").css({ "display": "block", "text-align": "center", "color": "red", "font-weight": "bold", "font-size": "3em", "margin": "50px auto" });
        //$("#ctl00_MainContainer_MainContainer").css({ "display": "none" });

        var data = JSON.parse(evt.data);
         
        $.ajax({
            type: "POST",
            contentType: "application/json; charset=utf-8",
            url: "RptStudentCertificate.aspx/VerifyClient",
            data: "{'macAddress':'" + data.MACAddress + "', 'ipAddress':'" + data.IPAddress + "', 'userAccount':'" + encodeURIComponent(data.UserAccountName) + "', 'deviceId':'" + data.DeviceId + "'}",
            dataType: "json",
            success: function (data) {
                var result = data.d;

                if (result == "5") {
                    $("#ctl00_MainContainer_MainContainer").css({ "display": "block" });
                    document.getElementById('ctl00_MainContainer_BannerContainer').innerHTML = "Checking on UCAM Desktop Client...";

                    $("#ctl00_MainContainer_BannerContainer").css({"display":"none"});
                } else {
                    document.getElementById('ctl00_MainContainer_BannerContainer').innerHTML = "You're not authorized to access this page.";
                    $("#ctl00_MainContainer_BannerContainer").css({"display":"block","text-align":"center", "color":"red", "font-weight":"bold", "font-size":"3em", "margin":"50px auto"});
                    $("#ctl00_MainContainer_MainContainer").css({"display":"none"});
                }
            },
            error: function (e) {
                console.log(e);

                document.getElementById('ctl00_MainContainer_BannerContainer').innerHTML = "You're not authorized to access this page.";
                $("#ctl00_MainContainer_BannerContainer").css({ "display": "block", "text-align": "center", "color": "red", "font-weight": "bold", "font-size": "3em", "margin": "50px auto" });
                $("#ctl00_MainContainer_MainContainer").css({ "display": "none" });
            }
        });
    };


    ws.onopen = function () {
        console.log('connection open');
        ws.send('');
        document.getElementById('ctl00_MainContainer_BannerContainer').innerHTML = "Checking on UCAM Desktop Client...";
    };

    ws.onclose = function () {
        //console.log('connection closed'); 
        document.getElementById('ctl00_MainContainer_BannerContainer').innerHTML = "<small>Checking on UCAM Desktop Client</small> <br /> if this message persist <br /> <small>Ensure UCAM Desktop Client is running and refresh this page again.</small>";
        $("#ctl00_MainContainer_BannerContainer").css({ "display": "block", "text-align": "center", "color": "grey", "font-weight": "bold", "font-size": "3em", "margin": "50px auto" });
        $("#ctl00_MainContainer_MainContainer").css({ "display": "none" });
    }

    //form.addEventListener('submit', function(e){
    //    e.preventDefault();
    //    var val = input.value;
    //    ws.send('');
    //    //input.value = "";
    //});

}


