function UploadToServer(roll,blob) {
    //var blob = doc.output("datauristring");
    $.ajax({
        type: "POST",
        //data: JSON.stringify(formData),          //backend language, it may looks like '/model/send.php'
        dataType: 'text',
        //contentType: false,
        processData: false,
        contentType: "application/json; charset=utf-8",
        url: "RptStudentCertificate.aspx/LoadCertificateSave",
        data: "{file:'" + JSON.stringify(blob) + "', Roll:'" + roll + "'}",

        //data: "{'file': " + JSON.stringify(blob) + "}",

        //async: true,
        success: function (data) {
            ArchiveLoopComplete++;
            if (ArchiveLoopComplete == ArchiveLoopCompleteList) {
                alert('File Archived: ' + ArchiveLoopCompleteList);
            }
            return true;

        },
        error: function (data) { return false; }

    });
    
}